import React from 'react';
import  useWebsocket from 'use-websocket';

const TagForm = () => {
  const { lastJsonMessage } = useWebsocket('ws://localhost:8082'); // Substitua pelo seu endereço WebSocket

  return (
    <div>
      <h1>Tag recebida no frontend:</h1>
      <p>{lastJsonMessage && lastJsonMessage.tag}</p>
    </div>
  );
};

export default TagForm;
